import React from 'react';
import Slider from 'react-slick';

const settings = {
  dots: true,
  infinite: true,
  speed: 500,
  slidesToShow: 1,
  slidesToScroll: 1,
  autoplay: false,
};
export default function Carrousel() {
  return (
    <>
      <Slider {...settings}>
        <div>
          <div>
            <div className="image-container">
              <img src="/carrousel/carrousel-item-1.jpg" alt="item-1" align="center" />
              <div>Puto el que lo lea</div>
            </div>
          </div>
        </div>
        <div>
          <div className="image-container">
            <img src="/carrousel/carrousel-item-2.jpg" alt="item-1" align="center" />
          </div>
        </div>
      </Slider>
      <style jsx>
        {`
        .image-container {
          max-width: 100vw;
          height: 500px;
        }
        .image-container img {
          width: 100%;
          position: relative;
          color: black;
          object-fit: cover;
          vertical-align: center;
        }
        .image-container div{
          position: absolute;
          top: 50%;
          left: 50%;
          transform: translate(-50%, -50%);
        }
        `}
      </style>
    </>
  );
}
